import './App.css';

function App() {
  return (
    <div className="App">
      <h1>CRUD APPLICATION</h1>

      <div className="form">
        <h1>Add a Product</h1>
        <label>Product Name:</label>
        <input type="text" name="productName"/>
        <label>Quantity:</label>
        <input type="number" name="quantity"/>
        <label>Price:</label>
        <input type="number" name="price"/>

        <button>Submit</button>
      </div>
    </div>
  );
}

export default App;
